import React from 'react';
// import { useContext } from 'react';
import { Routes, Route, Navigate} from 'react-router-dom';
// import AuthContext from './store/auth-context';
import Signup from './components/Registration/SignUp';
import ForgetPass from './components/Forget/ForgetPass';
import HomePage from './pages/HomePage';
import SignIn from './components/Login/SignIn';

import CameraView from './components/pagess/Camera-view';
import RealtimeDisplay from './components/pagess/Real-time-Display';
import RecordAnalysis from './components/pagess/Record-analysis';
import Account from './components/pagess/Account';

function App() {
  // const authCtx = useContext(AuthContext);
  return (

      <Routes>

        <Route path="/" element={<SignIn />} /> 

        <Route path="/Signup" element={<Signup />} />
        <Route path="/Forget" element={<ForgetPass />} />

        <Route path="/Home" element={<HomePage />} />
        <Route path="/Home/:HomeId" element={<CameraView />} />
        <Route path="/Home/:HomeId" element={<RealtimeDisplay />} />
        <Route path="/Home/:HomeId" element={<RecordAnalysis />} />
        <Route path="/Home/:HomeId" element={<Account />} />
        <Route path="/*" element={<Navigate to="/" />} />        


      </Routes>




  );
}

export default App;
